import React from 'react';
import MyJoke from './MyJoke';

 import jokeData from './jokeData';


function App() {
    jokeData.map(joke => {
        return (
                <MyJoke 
                    id={joke.id}
                    joke={joke.joke}
                />
        )
    })
}
export default App
